import React, { useEffect, useState } from 'react'

const Edit = ({datas}) => {
  let [dats,setdats] = useState([])

  useEffect(()=>{
    let dataS = localStorage.getItem("todo")
    setdats(JSON.stringify(dataS))

  },[])
  return (
    <div>
      {dats && dats.map((item)=>{
        <p>
          {item}
        </p>
      })}
    </div>
  )
}

export default Edit
